server {
    listen  443 ssl;
    server_name hk.trojan443.top;
    ssl_protocols   TLSv1.2 TLSv1.3;     #SSL协议版本
    ssl_certificate /usr/local/nginx/cert/tj443.pem;
    ssl_certificate_key /usr/local/nginx/cert/tj443.key; 
    ssl_session_cache   shared:SSL:10m;             # SSL TCP会话缓存设置共享内存区域名为# SSL，区域大小为10MB                                                   
